Indicators are necessary for city's performance measurement and management require, they support strategizing, monitoring and control, enable benchmarking and provide the basis for decision-making. 
Different frameworks and standards with smart and sustainable city indicators were suggested in order to support cross-city comparisons and simplify the creation of city-specific systems of indicators. Although standards with indicators have similar purpose, their contents vary.
The smart review compares the content of seven standards with smart and sustainable city's indicators::
1. ISO 37120:2018 Sustainable cities and communities  Indicators for city services and quality of life;  
2. ISO 37122:2019 Sustainable cities and communities  Indicators for smart cities; 
3. ETSI TS 103 463 Key Performance Indicators for Sustainable Digital Multiservice Cities; 
4. ITU-T Y.4901 Key performance indicators related to the use of information and communication technology in smart sustainable cities; 
5. ITU-T Y.4902 Key performance indicators related to the sustainability impacts of information and communication technology in smart sustainable cities; 
6. ITU-T Y.4903 Key performance indicators for smart sustainable cities to assess the achievement of sustainable development goals; 
7. UN SDG Goal 11: Monitoring Framework. 
This ORKG smart review presents the research results from the following paper:
Huovila, A., Bosch, P., & Airaksinen, M. (2019). Comparative analysis of standardized indicators for Smart sustainable cities: What indicators and standards to use and when? Cities, 89, 141-153. [https://www.sciencedirect.com/science/article/pii/S0264275118309120?via%3Dihub ](url)
""^^<http://www.w3.org/2001/XMLSchema#string>
